import { useState, useEffect } from 'react'
import BabyService from './services/baby'

function App() {
  const [ babyList, setBabyList ] = useState([])
  useEffect(async ()=>{
    const list = await BabyService.getBabyList()
    setBabyList(list)
  },[])

  return (
    <>
      babyList.map(baby=>(
        <p>{baby.first_name} {baby.middle_name}</p> get over here!
      ))
    </>
  );
}

export default App;
